  outline: none;
}
.recaptcha-terms-of-use--link-button.-hidden {
  visibility: hidden;
}
.recaptcha-terms-of-use--disclosure {
  visibility: hidden;
  opacity: 0;
  -webkit-transition: height 0.5s ease, opacity 0.5s ease;
  -o-transition: height 0.5s ease, opacity 0.5s ease;
  -moz-transition: height 0.5s ease, opacity 0.5s ease;
  transition: height 0.5s ease, opacity 0.5s ease;
}
.recaptcha-terms-of-use--disclosure.-visible {
  visibility: visible;
  opacity: 1;
}
.recaptcha-terms-of-use--disclosure.-absolute {
  position: absolute;
